import galleryImg01 from './image/adventure.webp';
import galleryImg02 from './image/art-culture.webp';
import galleryImg03 from './image/beaches.webp';


const images = [
      galleryImg01,
      galleryImg02,
      galleryImg03,
      galleryImg03,
]

export default images;
